INSERT INTO `stock` (`ID`, `livroName`, `livroPrice`, `livroDescription`, `livroCategory`, `livroSubCategory`, `totalOrders`, `img_url`, `img_name`) VALUES
(1, 'Sabores da Época', '7', 'Neste livro, Rui Paula, um dos mais conceituados chefs portugueses, regressa às origens e propõe receitas intemporais que respeitam a sazonalidade e valorizam os produtos locais, cumprindo a sabedoria do velho ditado – «Cada coisa tem o seu tempo»..Ao longo das 50 receitas deste livro, redescobrimos pratos e ingredientes típicos da nossa cultura, alguns deles injustamente esquecidos, que aqui recuperam todo o seu esplendor. Experimente e... Bom proveito!                                                                        ', 1, 1, 9, , 'Manger-Comme-un-Portugais.jpg');
INSERT INTO `stock` (`ID`, `livroName`, `livroPrice`, `livroDescription`, `livroCategory`, `livroSubCategory`, `totalOrders`, `img_url`, `img_name`) VALUES
(2, 'O Amor Não Morreu', '4', 'Florence Day é a escritora-fantasma de uma das mais amadas autoras de romances cor-de-rosa, e tem um problema – após uma separação dolorosa, deixou de acreditar no amor. Quando o seu novo editor, um homem organizado e meticuloso (e demasiado bonito para ser verdadeiro), se recusa a adiar novamente o prazo de entrega do próximo livro, Florence prepara-se para dizer adeus à carreira. Mas é então que recebe uma terrível notícia e tem de fazer algo que anda a evitar há uma década: regressar a casa para o funeral do pai.', 2, 2, 4, , '1540-1.jpg');
INSERT INTO `stock` (`ID`, `livroName`, `livroPrice`, `livroDescription`, `livroCategory`, `livroSubCategory`, `totalOrders`, `img_url`, `img_name`) VALUES
(3, 'O Cérebro da Criança', '5', 'Doze estratégias revolucionários para treinar o cérebro em desenvolvimento do seu filho. \"O Cérebro da Criança\" é uma abordagem revolucionária à educação, que contempla doze estratégias-chave, adaptadas a cada idade – dos 0-3; dos 3-6; dos 6-9 e dos 9-12 anos, que fomentam o desenvolvimento saudável do cére­bro, fazendo com que as crianças sejam mais calmas e felizes.', 3, 3, 5, , 'O-Cerebro-da-Crianca.jpg');
INSERT INTO `stock` (`ID`, `livroName`, `livroPrice`, `livroDescription`, `livroCategory`, `livroSubCategory`, `totalOrders`, `img_url`, `img_name`) VALUES
(4, 'Gestão Estratégica Conce', '6', 'Pensar estrategicamente a organização é essencial ao sucesso da empresa no mercado e face às empresas concorrentes. Mas, pensar estrategicamente requer a compreensão do que é a estratégia, do ambiente externo e interno, dos diversos níveis de estratégia - de negócio, funcional, corporativa e internacional -, e da sua implementação e controlo. Todas estas vertentes fazem com que a compreensão dos conceitos de estratégia e a sua aplicação não sejam tarefa fácil para os estudantes e executivos.', 4, 4, 0, , 'Gestao-Estrategica-Conceitos-e-Pratica.jpg');
INSERT INTO `stock` (`ID`, `livroName`, `livroPrice`, `livroDescription`, `livroCategory`, `livroSubCategory`, `totalOrders`, `img_url`, `img_name`) VALUES
(5, 'Ramsay em 10 Minutos', '4', 'Com Ramsay em 10 minutos, aprenderá a cozinhar pratos incríveis num instante.Quer seja Souvlaki de Frango, para impressionar toda a família, Caril de peixe à goesa, para fazer crescer água na boca, ou uma sobremesa super-rápida, como o Pudim caramelizado no micro-ondas, todas são receitas repletas de sabor que se tornarão clássicas em pouco tempo.', 1, 1, 0, , '1540-1 (1).jpg');

